<div class="entities" style="line-height: 2.5; direction: ltr">Managing the underlying cause of cystic fibrosis : a future role for potentiators and correctors . Cystic fibrosis ( CF ) , a severe genetic disease , is caused by mutations that alter the structure and function of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , a plasma membrane channel permeable to chloride and bicarbonate . Defective anion transport in CF irreversibly damages the lungs , pancreas , liver , and other organs . CF mutations cause loss of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 function in multiple ways . In particular , class 3 mutations such as p . Gly 551Asp strongly decrease the time spent by 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in the open state ( gating defect ) . Instead , class 2 mutations impair the maturation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 protein and its transport from the endoplasmic reticulum to the plasma membrane ( trafficking defect ) . The deletion of phenylalanine 508 ( p . Phe 508del ) , the most frequent mutation among CF patients ( 70-90 % ) , destabilizes the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 protein , thus causing both a trafficking and a gating defect . These two defects can be overcome with drug-like molecules generically called correctors and potentiators , respectively . The potentiator Kalydeco  ( also known as 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08820
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 or VX - 770 ) , developed by Vertex Pharmaceuticals , has been recently approved by the US FDA and the European Medicines Agency ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P15941
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) for the treatment of CF patients carrying at least one 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13569
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 allele with the p . Gly 551Asp mutation ( 2-5 % of all patients ) . In contrast , the corrector VX - 809 , which significantly improves p . Phe 508del -

<div class="entities" style="line-height: 2.5; direction: ltr">Flow cytometric analysis of mammalian glial cultures treated with methotrexate .

 ) . MTX treatment of cultured cell lines leads to the emergence of resistant cell populations . Studies using stepwise selection procedures have demonstrated that MTX resistance conferred by overproduction of

 can be caused by

 gene amplification . We examined the effect of MTX on cells whose origin more closely approximates the in vivo condition by developing a culture system using dissociated brain tissue from 17-19 day old mouse embryos . At the first passage , cultures were divided into control and MTX groups . Cells were treated with the same or successively higher concentrations of MTX at each passage over a 3-4 month period . The first passage eliminated neurons and left a glial culture comprised of approximately 90 % astrocytes . We used the Fluorescence Activated Cell Sorter in conjunction with fluorescent dyes to measure

 content , DNA content , size , and viability of glial cells following MTX treatment . MTX-treated cells divided but grew more slowly and were larger than untreated cells . Stepwise selection in 30/60 / 90 nM or 60/120 nM MTX resulted in significant two - to threefold increases in fluorescence , and hence

 levels . Slot hybridizations assays demonstrated a threefold increase in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 gene copy number in the DNA from the 30/60 / 90 cultures . Thus , our findings were consistent with the results obtained from somatic cell lines , and lend support to the hypothesis that gene amplification may be a common mechanism for the acquisition of resistance in many types of cells . They also indicate that glial cells may be a specific target for cytotoxic effects of MTX on the central nervous system .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Evaluation of the pharmacokinetics , preclinical and clinical efficacy of pralatrexate for the treatment of T-cell lymphoma . INTRODUCTION : Peripheral T-cell lymphomas ( PTCLs ) are a heterogeneous group of T-cell neoplasms . Most patients with PTCL have a poor outcome with conventional therapies and are not cured without stem-cell transplantation .

</mark>
 , a novel antifolate chemotherapeutic agent , was rationally designed to impede folate metabolism by inhibiting dihydrofolate reductase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) and to be more efficiently internalized into tumor cells . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB06813
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">SUB</span>
</mark>
 is the first drug that is FDA approved for patients with relapsed and refractory PTCL . AREAS COVERED : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 has been used as a single agent and in combination with other agents in clinical trials for non-Hodgkin ' s lymphoma and Hodgkin ' s disease as well as in solid tumors . This review will cover the development of pralatrexate , the pharmacokinetics of pralatrexate , preclinical findings with pralatrexate and clinical studies of pralatrexate in hematologic malignancies . EXPERT OPINION : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 has significant activity in vitro , and in early Phase I / II trials , responses were noted in patients with aggressive T-cell lymphomas . The 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 in Patients with Relapsed or Refractory Peripheral T-Cell Lymphoma trial demonstrated the activity of pralatrexate across a spectrum of heavily pretreated patients with different aggressive T-cell lymphoma subtypes , and studies in cutaneous T-cell lymphoma have shown efficacy at different doses and schedules . The most frequent adverse events in these trials were mucositis , reversible thrombocytopenia and fatigue .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Functional characteristics of calcium-sensitive adenylyl cyclase of ciliate Tetrahymena pyriformis ] . DB01373 - sensitive forms of adenylyl cyclase ( AC ) were revealed in most vertebrates and invertebrates and also in some unicellular organisms , in particular ciliates . We have shown for the first time that calcium cations influence the AC activity of ciliate Tetrahymena pyriformis . These cations at the concentrations of 0.2- 20 microM stimulated the enzyme activity , and maximum of catalytic effect was observed at 2 microM Ca2 + . DB01373 cations at a concentrations of 100 microM or higher inhibited the AC activity . P62158 antagonists W - 5 and W - 7 at the concentrations of 20-100 microM inhibited the catalytic effect induced by 5 microM Ca2 + and blocked the effect at higher concentrations of Ca2 + .

 , another calmodulin antagonist , reduced Ca2 + - stimulated AC activity only at the concentrations of 200-1000 microM . AC stimulating effects of serotonin ,

<div class="entities" style="line-height: 2.5; direction: ltr">Glucocorticoid-induced surface expression of annexin 1 blocks beta 2 - integrin adhesion of human eosinophils to intercellular adhesion molecule 1 surrogate protein . BACKGROUND : Glucocorticoids attenuate the population of eosinophils and T lymphocytes in asthmatic airways . The decrease in airway eosinophilia is caused both by accelerated cell death and by induction of blockade of integrin adhesion . In this study , we examined the hypothesis that annexin 1 surface expression , which is upregulated by the glucocorticoid receptor , prevents integrin adhesion essential to cell migration by blocking intracellular translocation of cytosolic group IV phospholipase A2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) . OBJECTIVE : To examine the relationship of the glucocorticoid on annexin 1 expression and the effect of blockade of annexin 1 activity on adhesion of human eosinophils in vitro . To determine the relationship between annexin 1surface expression and nuclear membrane translocation of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 . METHODS : Eosinophils isolated from human peripheral blood were pretreated with fluticasone propionate ( FP ) , and beta 2 - integrin adhesion was measured after stimulation with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 or eotaxin . Effects of FP on

 decreased stimulated eosinophil adhesion and caused 4 - fold increase in annexin 1 expression on the plasma membrane . Inhibition of adhesion by FP was blocked with annexin 1 blocking antibody . Annexin 1 N-terminal mimetic peptide also blocked beta 2 - integrin adhesion . Translocation of

 has similar side effects to other

 provides clinical benefit to patients with relapsed or refractory PTCL with durable complete and partial responses in patients who had not responded to multiple prior treatment regimens .</div>

<h2 style="margin: 0">26</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Development of stable cell lines expressing different subtypes of GABAA receptors . The experiments reported here were motivated by our interest to express in stably-transfected cells large amounts of recombinant rat GABAA receptors . For this , we developed an original two step selection strategy , in which the first step consisted of transfecting 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 293 cells with rat GABAA receptor alpha and beta subunits . G 418 resistant colonies isolated at this step were screened for [ 3H ] muscimol binding to select for those that coexpressed alpha - and beta-subunits . The best alpha and beta subunit expressing colony was then supertransfected with a plasmid coding for the gamma rat GABAA receptor subunit and a mutant 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 gene . After a second round of selection , this time in presence of methotrexate , those colonies that coexpressed ternary alpha beta gamma GABAA receptor combinations were distinguished using [ 3H ] flumazenil as a probe . This strategy was applied to the isolation of 3 GABAA receptor clones , alpha 1 beta 2 gamma 2s , alpha 3 beta 2 gamma 2s and alpha 5 beta 3 gamma 2s , that expressed relatively high levels of these proteins . These 3 cell lines exhibited pharmacological and functional properties similar to cells transiently-transfected with equivalent subunit combinations . These cell lines therefore provide attractive models with which to evaluate the intrinsic activity and potency of compounds at recombinant GABAA receptor subtypes .</div>

<h2 style="margin: 0">27</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Spline-fitting with a genetic algorithm : a method for developing classification structure-activity relationships . Classification methods allow for the development of structure-activity relationship models when the target property is categorical rather than continuous . We describe a classification method which fits descriptor splines to activities , with descriptors selected using a genetic algorithm . This method , which we identify as SFGA , is compared to the well-established techniques of recursive partitioning ( RP ) and soft independent modeling by class analogy ( SIMCA ) using five series of compounds : cyclooxygenase - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354

</mark>
 ) inhibitors , benzodiazepine receptor ( BZR ) ligands , estrogen receptor ( ER ) ligands , dihydrofolate reductase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) inhibitors , and monoamine oxidase ( MAO ) inhibitors . Only 1 - D and 2 - D descriptors were used . Approximately 40 % of compounds in each series were assigned to a test set , &quot; cherry-picked &quot; from the complete set such that they lie outside the training set as much as possible . SFGA produced models that were more predictive for all but the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00374
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 set , for which SIMCA was most predictive . RP gave the least predictive models for all but the MAO set . A similar trend was observed when using training and test sets to which compounds were randomly assigned and when gradually eliminating compounds from the ( designed ) training set . The stability of models was examined for the random and reduced sets , where stability means that classification statistics and the selected descriptors are similar for models derived from different sets . Here , SIMCA produced the most stable models , followed by SFGA and RP . We show that a consensus approach that combines all three methods outperforms the single best model for all data sets .</div>
